pragma solidity >=0.4.21 <0.6.0;

import "../node_modules/openzeppelin-solidity/contracts/math/SafeMath.sol";
import "../node_modules/openzeppelin-solidity/contracts/token/ERC20/ERC20Basic.sol";

contract tracrToken is ERC20Basic {
    using SafeMath for uint256;

    mapping(address => uint256) internal balances;

    uint256 internal totalSupply_;
    string public name;
    string public symbol;
    uint8 public decimals;

    // assumption: only consortium members can use balance and transfer functions
    mapping(address => bool) internal isMember;

    modifier checkMembership(address _user) {
        require(isMember[_user], "this user is not a consortium member");
        _;
    }
    constructor(string _name, string _symbol, uint8 _decimals, uint256 _totalSupply,
        address memberA, uint256 balanceA, 
        address memberB, uint256 balanceB, 
        address memberC, uint256 balanceC)
        public {
        name = _name;
        symbol = _symbol;
        decimals = _decimals;
        totalSupply_ = _totalSupply;
        //  setting initial balances of consortium members
        //  assuming addresses/wallets are known
        balances[memberA] = balanceA;
        balances[memberB] = balanceB;
        balances[memberC] = balanceC;

        isMember[memberA] = true;
        isMember[memberB] = true;
        isMember[memberC] = true;

        require(
            balances[memberA].add(balances[memberB].add(balances[memberC])) == totalSupply_, 
            "total of balances is not equal to totalSupply");
    }

    /**
    * @dev Total number of tokens in existence
    */
    function totalSupply() public checkMembership(msg.sender) view returns (uint256) {
        return totalSupply_;
    }

    /**
    * @dev Transfer token for a specified address
    * @param _to The address to transfer to.
    * @param _value The amount to be transferred.
    */
    function transfer(address _to, uint256 _value) public 
        checkMembership(msg.sender) 
        checkMembership(_to)
        returns (bool) 
    {
        require(_value <= balances[msg.sender], "senders balance is greater than _value");
        require(_to != address(0), "_to address is zero address 0x0");
        balances[msg.sender] = balances[msg.sender].sub(_value);
        balances[_to] = balances[_to].add(_value);
        emit Transfer(msg.sender, _to, _value);
        return true;
    }

    /**
    * @dev Gets the balance of the specified address.
    * @param _owner The address to query the the balance of.
    * @return An uint256 representing the amount owned by the passed address.
    */
    function balanceOf(address _owner) public 
        checkMembership(msg.sender) 
        //checkMembership(_owner)
        view returns (uint256) 
    {
        return balances[_owner];
    }
}

